import './navbar.css';
import React from 'react'

export const Navbar = () => {
  return (
    <div className="gpt3_navbar">
      <div className="gpt3_navbar-links">
         <div className="gpt3_navbar-links_logo">
           <img src="{logo}" alt="logo" />
         </div>
      </div>
    </div>
  )
}
